import React from "react";

function TimeTable({ data }) {
    let table = null;

    if (data != null && data.length > 0) {
        table = (
            <table>
                <tr>
                    <th>Day</th>
                    <th>Start Time</th>
                    <th>End Time</th>
                </tr>
                {data.map(item => {
                    return (
                        <tr>
                            <td>item.day</td>
                            <td>item.time</td>
                        </tr>
                    );
                })}
            </table>
        );
    }

    return table;
}

export default TimeTable;
